INSERT INTO `faqs` (`id`, `question`, `sequence`, `ans`, `created_at`, `updated_at`) VALUES
(1, 'What types of immigration cases do you handles?', 1, '<p>We handle a diverse range of immigration cases, including family-based petitions, employment-based visas, and refugee matters. Our services extend to deportation defense, visa extensions, and waivers of inadmissibility. With a focus on personalized guidance, we assist clients in navigating complex immigration laws and procedures. Our experienced team advocates for clients&#39; rights in immigration court and provides representation in appeals and litigation proceedings. we are committed to achieving favorable outcomes for our clients.</p>', '2024-07-04 07:46:24', '2024-07-04 07:46:24'),
(2, 'How experienced are your legal professionals in handling immigration matters?', 6, '<p>Our legal professionals are highly experienced in handling immigration matters, with a proven track record of success. Many of our attorneys specialize exclusively in immigration law, dedicating their careers to mastering the intricacies of this complex field. With years of practical experience and continuous training in the evolving landscape of immigration laws and policies, our team is well-equipped to navigate various immigration challenges effectively. We have successfully represented countless clients in a wide range of immigration cases, from routine visa applications to complex deportation defense and appeals. Our commitment to excellence and client satisfaction underscores our dedication to providing top-tier legal representation in all immigration matters.</p>', '2024-07-07 02:36:43', '2024-07-07 02:36:43');
