(1, 'Md Shafiqur Rahman', 'Director & Immigration Advisor', 'Saimum@saimumchambers.com', 'image1720221084.png', 'image1720340167.png', '<ul>\r\n	<li>Our Senior consultant, who has been practicing immigration law since 2014 in the UK, has bagged huge experience in the Immigration practice field. He is the Director of the Saimum Chambers and OISC regulated Immigration advisor. He is also a senior Legal Consultant in Ascentim Legal Solicitors, a UK based Solicitor firm.</li>\r\n	<li>He has completed his LLB from Bangladesh and his Diploma in Law from the University of London. Besides this, he is contributing in different research projects and research publications.</li>\r\n	<li>His passion for immigration law stems from his own personal journey and his desire to help others achieve their goals and dreams. He has learned from working and volunteering with various organisations and legal professionals, such as Barrister Mohammad Muzibur Rahman, Barrister and CILEX Fellow Z T Simret ESQ, and Barrister David Jones, who has mentored and inspired him.</li>\r\n	<li>He has been shadowing Barrister David Jones since 2019 and has attended many Tribunals and courts to know the court proceedings and understand the roles of a Barrister. He has honed his skills in legal research, writing, assistance, interviewing, compliance, and drafting, as well as my knowledge of the latest immigration rules and regulations. To further advance his career and pursue his aspiration to become a Barrister, He is currently studying LLB at Birkbeck, University of London, one of the finest Universities, where he can apply and enhance my legal acumen and critical thinking.</li>\r\n	<li>Notably, he has several mentors, among them David Jones from Garden Court Chambers and Mr ZT Simrat from Landmark Law Solicitors, from whom he is continuously receiving guidance and suggestions to become excellent.</li>\r\n</ul>\r\n\r\n<p>Education :</p>\r\n\r\n<p>1. LL.B. 2026 Birkbeck, University of London</p>\r\n\r\n<p>2. Diploma in Law, 2015, University of London</p>\r\n\r\n<p>3. LL.B. 2008 University of Development Alternative Bangladesh</p>\r\n\r\n<p>Court Visits/ Shadowing Barristers :</p>\r\n\r\n<p>1. Barrister David Jones</p>\r\n\r\n<p>2. ZT Simret ESQ</p>\r\n\r\n<p>3. Barrister Muzibur Rahman</p>\r\n\r\n<p>4. And many others</p>\r\n\r\n<p>Articles/Publications :</p>\r\n\r\n<p>1.⁠ ⁠Md. Shafiqur Rahman and Md. Salahuddin Mahmud &ldquo;Do the emergency services have a duty of care towards individual members of the public? A critique under the English tort law&rdquo; [2016] 2 International Journal of Law 77-81. (<a href=\"https://www.lawresearchjournal.com/archives/2016/vol2/issue6\" target=\"_blank\">https://www.lawresearchjournal.com/archives/2016/vol2/issue6</a>)</p>\r\n\r\n<p>2.⁠ ⁠Md. Shafiqur Rahman and Md. Salahuddin Mahmud &ldquo;The concept and status of Jus Cogens: An overview&rdquo; [2017] 3 International Journal of Law 111-114. (<a href=\"https://www.lawjournals.org/archives/2017/vol3/issue6\" target=\"_blank\">https://www.lawjournals.org/archives/2017/vol3/issue6</a>)</p>', '2', '000000000', '000000000', '000000000', '#', '2024-07-05 17:09:26', '2024-07-07 02:16:07');
