INSERT INTO `why_chooses` (`id`, `title`, `short`, `color`, `circle_color`, `created_at`, `updated_at`) VALUES
(1, 'Foremost Authority on UK Visa Regulations', '<p>In the intricate web of UK immigration law, it&#39;s imperative to have a guide wellversed in its complex and ever-shifting statutes. Our legal practitioners stand at the forefront, meticulously monitoring the latest amendments to the UK&#39;s immigration policies. We ensure your child&#39;s visa application is robustly aligned with the most recent UK Border Control mandates and Home Office stipulations.</p>', '#fe5557', '#22244e', NULL, '2024-07-07 02:00:05'),
(2, 'Bespoke Immigration Strategies', '<p>Recognising that your journey to the UK is as individual as your fingerprint, we extend custom-tailored advisory services. Our adept legal strategists forge bespoke pathways that resonate with your personal objectives and familial landscape. Entrust us with your aspirations; our firm is dedicated to crafting successful immigration outcomes that are as unique as your circumstances.</p>', '#21c6d1', '#ffc900', NULL, '2024-07-07 02:01:29'),
(3, 'Integral UK Immigration Assistance', '<p>Venture into the UK immigration landscape with a guardian that orchestrates every element of your case with unparalleled proficiency. From initiating visa applications to permanent settlement and the pursuit of British citizenship, we deliver an all-encompassing suite of services designed to streamline and demystify your immigration experience.</p>', '#0c4944', '#fe5557', NULL, '2024-07-07 02:02:43'),
(4, 'Legal Prowess Unmatched', '<p>Our consortium of immigration advisor brings forth a distinguished legacy of navigating the UK&#39;s immigration law ecosystem. Specialising in a spectrum ranging from family visas to tier-based employment authorisations, our expertise stands as a guiding light through the multifaceted processes of UK immigration.</p>', '#7026ff', '#5ae2cc', NULL, '2024-07-07 02:03:59');
